import { AppBar, Divider, Icon, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Container,
    Popper,
    Paper,
    Fade,
    Grow,
    CardMedia,
  } from "@mui/material";

function MySkills(){
    return (
        <Container
          fixed
          sx={{
            bgcolor: "transparent",
            marginTop: '10vh', 
            marginBottom: '10vh',
            width: "100%",
            height: '80vh',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'space-between',
          }}
        >
            <h1>Skills</h1>
        </Container>
    );
};

export default MySkills;
